import './App.css';
import './components/nav.css';
import Nav from './components/Nav';

function App() {
  return (
    <Router>
      <Nav/>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/about" element={<About/>} />
        <Route path="/dev" element={<About/>} />
        <Route path="/design" element={<About/>} />
      </Routes>
    </Router>
  );
}

export default App;
